func TestActiveTransfers(t *testing.T) {
	data := getActiveTransferTestData()
	var resData []ActiveTransfer
	err := json.Unmarshal([]byte(data), &resData)
	if err != nil {
		t.Fail()
	}
	for _, transfer := range resData {
		fmt.Printf("transfer: %v\n", transfer.ChannelNonce)
	}
}

